INSERT INTO `videogame` (`id`, `name`, `poster`, `resume`, `release_date`, `created_at`, `updated_at`, `slug`) VALUES
(1,	'Super Mario Odyssey',	'https://vgmsite.com/soundtracks/super-mario-odyssey-original-soundtrack/Super%20Mario%20Odyssey%20Cover.jpg',	'Bowser enlève Peach pour se marier avec elle. Mario rencontre une créature ressemblant à un chapeau, un Chapiforme, portant le nom de Cappy. Bowser a aussi enlevé sa sœur, Tiara. Mario et Cappy récupèrent un vaisseau abandonné, l\'Odyssée, et voyagent de pays en pays à la poursuite de Bowser. Dans la majorité des mondes, ils doivent combattre les Broodals, une bande de lapins anthropomorphiques organisateurs de mariage qui essaie de les empêcher de rattraper Bowser et d\'arrêter le mariage.',	'2018-02-28 00:00:00',	'2023-09-20 22:55:19',	'2023-08-25 01:58:44',	'super-mario-odyssey'),
(2,	'The Legend of Zelda: Ocarina of Time',	'https://images.igdb.com/igdb/image/upload/t_cover_big/co3nnx.png',	'Ocarina of Time raconte l\'histoire de Link, un jeune garçon vivant dans un village perdu dans la forêt, qui parcourt le royaume d\'Hyrule pour empêcher Ganondorf d\'obtenir la Triforce, une relique sacrée partagée en trois : le courage (Link), la sagesse (Zelda) et la force (Ganondorf).',	'2003-01-01 00:00:00',	'2023-09-20 22:55:35',	NULL,	'the-legend-of-zelda-ocarina-of-time'),
(3,	'Minecraft',	'https://image.api.playstation.com/vulcan/img/cfn/11307x4B5WLoVoIUtdewG4uJ_YuDRTwBxQy0qP8ylgazLLc01PBxbsFG1pGOWmqhZsxnNkrU3GXbdXIowBAstzlrhtQ4LCI4.png',	'Minecraft est un jeu de type bac à sable, c\'est à dire qu\'il intègre des “outils” pour façonner son propre univers de jeu. Ainsi , le joueur peut à peu près bâtir tout ce qu\'il veut. Il existe différents modes de jeu dans lesquels la partie aventure et la partie créative sont plus ou moins développées.',	'2009-01-01 00:00:00',	'2023-09-20 22:55:42',	NULL,	'minecraft'),
(4,	'Geometry Dash',	'https://play-lh.googleusercontent.com/ixHXzBWPmmKWIBxDMfjbIXK10UQCTDvIYOcs_uLXHCRbdsz2siJFYfb7MqckU8eC3Ks',	'Geometry Dash est un jeu en défilement horizontal dans lequel le joueur dirige une icône qui glisse sur le sol et qui doit sauter pour éviter divers obstacles tels que des blocs, des pics, des scies circulaires, des monstres, des boules de feu et des rayons électriques, le plus souvent en rythme avec la musique ...',	'2013-08-13 00:00:00',	'2023-09-20 22:55:55',	NULL,	'geometry-dash'),
(5,	'The Legend of Zelda',	'https://vgmsite.com/soundtracks/the-legend-of-zelda-nes/coverart.jpg',	'The Legend of Zelda est une série d\'action-aventure (et action-RPG). Elle met en scène la lutte éternelle des différentes réincarnations du héros Link et de la Princesse Zelda contre Ganondorf, le Seigneur du Malin qui souhaite obtenir la Triforce.',	'1986-01-01 00:00:00',	'2023-08-12 13:35:24',	NULL,	'the-legend-of-zelda'),
(6,	'Zelda II: The Adventure of Link',	'https://images.igdb.com/igdb/image/upload/t_cover_big/co1uje.png',	'Dans Zelda II™: The Adventure of Link™, Link part à la recherche de la Triforce du Courage afin de réveiller la Princesse Zelda, plongée dans un profond sommeil par un magicien diabolique. Pendant ce temps, les sbires de Ganon tentent de ressusciter leur maître...',	'1988-09-28 00:00:00',	'2023-09-20 23:00:02',	NULL,	'zelda-ii-the-adventure-of-link'),
(7,	'The Legend of Zelda: A Link to the Past',	'https://images.igdb.com/igdb/image/upload/t_cover_big/co5x34.png',	'L\'histoire est centrée autour de Link et sa quête pour sauver le royaume d\'Hyrule du maléfique Ganon. Son aventure le mènera à sauver la princesse Zelda, libérer les sept jeunes Filles descendantes des sept sages et conquérir la légendaire Triforce. Le jeu fut un immense succès critique et commercial.',	'1991-11-21 00:00:00',	'2023-09-20 23:00:09',	NULL,	'the-legend-of-zelda-a-link-to-the-past'),
(8,	'The Legend of Zelda: Link\'s Awakening',	'https://images.igdb.com/igdb/image/upload/t_cover_big/co3nnt.png',	'L\'embarcation de Link est prise dans une tempête, et le héros s\'échoue en début d\'aventure sur l\'île de Cocolint. Il lui faut alors se mettre à la recherche des huit instruments des sirènes, afin de réveiller le dieu protecteur de l\'île, le Poisson-Rêve, qui dort enfermé dans un œuf géant au sommet de l\'île.',	'1993-12-01 00:00:00',	'2023-09-20 23:00:14',	NULL,	'the-legend-of-zelda-links-awakening'),
(9,	'The Legend of Zelda: Majora\'s Mask',	'https://images.igdb.com/igdb/image/upload/t_cover_big/co3pah.png',	'Link, à la recherche de Navy, sa fée dont il a été séparé lors de son dernier combat contre Ganondorf, croise le chemin d\'un curieux personnage masqué nommé Skullkid. Ce dernier sous l\'emprise des pouvoirs de son masque risque de provoquer la destruction du monstre.',	'2000-11-17 00:00:00',	'2023-09-20 23:00:20',	NULL,	'the-legend-of-zelda-majoras-mask'),
(10,	'The Legend of Zelda: Oracle of Seasons',	'https://images.igdb.com/igdb/image/upload/t_cover_big/co2tw0.png',	'The Legend of Zelda : Oracle of Seasons est un jeu d\'action et d\'aventure sur Gameboy. Onox, le général des ténèbres, a capturé l\'Oracle des Saisons afin de vider le royaume de toute vie. Les saisons sont en désordre et les forces du chaos grandissent.',	'2001-10-05 00:00:00',	'2023-08-20 01:53:08',	NULL,	'the-legend-of-zelda-oracle-of-seasons'),
(11,	'The Legend of Zelda: Oracle of Ages',	'https://media.senscritique.com/media/000017763543/0/the_legend_of_zelda_oracle_of_ages.jpg',	'Après avoir combattu pour protéger l\'oracle des saisons, Link se doit de relever un nouveau défi en poursuivant la déesse maléfique Vera qui a pris possession de l\'oracle des âges. Celle-ci compte profiter de ses voyages dans le temps pour faire renaître le seigneur des ténèbres...',	'2001-10-05 00:00:00',	'2023-08-20 01:54:43',	NULL,	'the-legend-of-zelda-oracle-of-ages'),
(12,	'The Legend of Zelda: Four Swords',	'https://images.igdb.com/igdb/image/upload/t_original/co5w9w.jpg',	'L\'arme de la légende : « l\'épée de quatre » ! C\'est elle qui, autrefois, a permis de sceller Vaati, un maléfique Mage du Vent à Hyrule. Pour délivrer la Princesse Zelda, kidnappée par un mystérieux personnage, surnommé Link Noir, notre héros Link est contraint de briser le sceau pour récupérer la fameuse arme.',	'2005-04-07 00:00:00',	'2023-08-20 01:57:32',	NULL,	'the-legend-of-zelda-four-swords'),
(13,	'The Legend of Zelda: The Wind Waker',	'https://media.senscritique.com/media/000016387216/0/the_legend_of_zelda_the_wind_waker.jpg',	'Link vit paisiblement sur sa petite île quand sa soeur est enlevée par un énorme oiseau! Évidemment, notre héros qui ne quitte jamais son épée et son bouclier se lance à sa poursuite. Ses recherches l\'entraînent dans une aventure épique à travers des terres étranges et des hautes mers.',	'2003-05-02 00:00:00',	'2023-08-20 01:59:14',	NULL,	'the-legend-of-zelda-the-wind-waker'),
(14,	'The Legend of Zelda: The Minish Cap',	'https://cdn.gamekult.com/images/photos/30/50/16/93/the-legend-of-zelda-the-minish-cap-jaquette-ME3050169384_2.jpg',	'La Princesse Zelda a été changée en pierre par le maléfique Vaati. Pour mettre fin à cette malédiction, Link doit partir à fa recherche des Minish vivant dans la forêt de Tyforia. C\'est en chemin qu\'il fait la connaissance d\'Exelo, un être à l\'aspect étrange.',	'2004-11-12 00:00:00',	'2023-08-20 02:00:54',	NULL,	'the-legend-of-zelda-the-minish-cap'),
(15,	'The Legend of Zelda: Four Swords Adventures',	'https://assets1.ignimgs.com/2019/06/04/legend-of-zelda-four-swords-adventure---button-1559683061454.jpg',	'L\'arme de la légende : « l\'épée de quatre » ! C\'est elle qui, autrefois, a permis de sceller Vaati, un maléfique Mage du Vent à Hyrule. Pour délivrer la Princesse Zelda, kidnappée par un mystérieux personnage, surnommé Link Noir, notre héros Link est contraint de briser le sceau pour récupérer la fameuse arme.',	'2005-01-07 00:00:00',	'2023-08-20 02:03:08',	NULL,	'the-legend-of-zelda-four-swords-adventures'),
(16,	'The Legend of Zelda: Twilight Princess',	'https://m.media-amazon.com/images/I/91CNKDOnSML.jpg',	'Lorsqu\'un mal terrible se répand sur les terres d\'Hyrule, Link le jeune fermier doit réveiller le héros, et l\'animal, qui sommeillent en lui. Lorsque Link parcourt le royaume des ténèbres, il se transforme en loup et doit sillonner le pays accompagné d\'une jeune fille mystérieuse nommée Midona.',	'2006-12-08 00:00:00',	'2023-08-20 02:04:37',	NULL,	'the-legend-of-zelda-twilight-princess'),
(17,	'The Legend of Zelda: Phantom Hourglass',	'https://image.jeuxvideo.com/images/ds/z/e/zephds0f.jpg',	'Link est accompagné dans son aventure par Ciela, une fée amnésique qui le trouve inconscient sur la plage de l\'île Melka et qui lui dispense des conseils pendant son aventure, et Linebeck, un capitaine lâche à la recherche de trésors qui prête son bateau à Link pour naviguer à travers les étendues d\'eau.',	'2007-10-19 00:00:00',	'2023-08-20 02:07:09',	NULL,	'the-legend-of-zelda-phantom-hourglass'),
(18,	'The Legend of Zelda: Spirit Tracks',	'https://media.senscritique.com/media/000005558312/0/the_legend_of_zelda_spirit_tracks.jpg',	'L\'histoire de The Legend of Zelda : Spirit Tracks prend place plus ou moins 100 ans après les évènements de Phantom Hourglass. Une nouvelle fois Link devra sauver la princesse Zelda qui cette fois-ci s\'est faite capturer son corps par un gang de bandit au service d\'un roi démon...',	'2009-12-11 00:00:00',	'2023-08-20 02:08:17',	NULL,	'the-legend-of-zelda-spirit-tracks'),
(19,	'The Legend of Zelda: Skyward Sword',	'https://image.jeuxvideo.com/images/jaquettes/00025815/jaquette-the-legend-of-zelda-skyward-sword-wii-cover-avant-g-1321266940.jpg',	'The Legend of Zelda: Skyward Sword est un jeu d\'action-aventure sur Wii dans lequel le joueur incarne l\'icône de la série : Link. Le héros devra sauver la princesse Zelda, en volant à dos de son Célestrier et en combattant des forces maléfiques grâce à une multitude d\'objets améliorables, dont l\'épée sacrée.',	'2011-11-18 00:00:00',	'2023-08-20 02:09:33',	NULL,	'the-legend-of-zelda-skyward-sword'),
(20,	'The Legend of Zelda: A Link Between Worlds',	'https://media.senscritique.com/media/000016342286/0/the_legend_of_zelda_a_link_between_worlds.jpg',	'The Legend of Zelda : A Link Between Worlds est un jeu d’action / aventure disponible sur Nintendo 3DS. Le titre fait suite à A Link to the Past sorti en 1992 sur Super Nintendo.',	'2013-11-22 00:00:00',	'2023-08-20 02:11:22',	NULL,	'the-legend-of-zelda-a-link-between-worlds'),
(21,	'The Legend of Zelda: Tri Force Heroes',	'https://image.jeuxvideo.com/medias/151256/1512557575-9914-jaquette-avant.jpg',	'Dans ce nouvel épisode de Zelda, l\'histoire nous conte les peines de la princesse Mousseline dont le royaume marqué par la mode a été frappé par une terrible malédiction : Mousseline se voit affublée d\'un collant horrible et n\'ose évidemment plus se montrer devant ses sujets.',	'2015-10-23 00:00:00',	'2023-08-20 02:12:51',	NULL,	'the-legend-of-zelda-tri-force-heroes'),
(22,	'The Legend of Zelda: Breath of the Wild',	'https://image.jeuxvideo.com/medias/149432/1494322310-8900-jaquette-avant.jpg',	'L\'histoire de Breath of the Wild est axée autour des quatre Prodiges, pilotes des créatures divines. Ceux-ci n\'ont pas réussi cent ans plus tôt à repousser les ombres de Ganon, qui les terrassèrent et prirent le contrôle de leurs créatures divines.',	'2017-03-03 00:00:00',	'2023-08-20 02:14:02',	NULL,	'the-legend-of-zelda-breath-of-the-wild'),
(23,	'The Legend of Zelda: Tears of the Kingdom',	'https://media.senscritique.com/media/000020906280/0/the_legend_of_zelda_tears_of_the_kingdom.jpg',	'The Legend of Zelda: Tears of the Kingdom » se déroule dans un royaume enchanté appelé Hyrule, où la paix est menacée par une force maléfique. Link, le héros légendaire doit se lancer dans une quête épique pour retrouver les larmes sacrées dispersées à travers le royaume.',	'2023-05-12 00:00:00',	'2023-08-20 02:15:15',	NULL,	'the-legend-of-zelda-tears-of-the-kingdom'),
(24,	'Assassin\'s Creed',	'https://store.ubisoft.com/dw/image/v2/ABBS_PRD/on/demandware.static/-/Sites-masterCatalog/default/dw3f3fd3a1/images/large/56c4947f88a7e300458b468e.png?sw=341&sh=450&sm=fit',	'Ce roman relate une des légendes entourant la forteresse d\'Alamut en actuel Iran, prise en 1090 par Hassan ibn al-Sabbah pour servir de base aux Nizârites, une communauté chiite ismaélienne, nommée aussi « secte des Assassins » ; ceux-ci auraient d\'ailleurs essayé de négocier avec l\'Ordre du Temple.',	'2007-01-01 00:00:00',	'2023-08-20 02:17:29',	NULL,	'assassins-creed'),
(25,	'Assassin\'s Creed Bloodlines',	'https://m.media-amazon.com/images/I/61bhmZRwPTS.jpg',	'En 1191 ap. J.-C., les Templiers envahissaient l\'île de Chypre. Partout où ils allaient, la violence se déchainait. Ils pensaient que la mer les protégerait de leur pire ennemi. Ils avaient tort. Il a passé sa vie dans l\'ombre et dans l\'oubli, obligeant les puissants à se soumettre et disparaissant pour écrire sa propre légende. Ses amis l\'appelaient Altaïr. Ses ennemis n\'ont pas eu le temps d\'apprendre son nom.',	'2009-11-20 00:00:00',	'2023-08-20 02:18:54',	NULL,	'assassins-creed-bloodlines'),
(26,	'Assassin\'s Creed II',	'https://www.gamecash.fr/thumbnail-600/assassins-creed-2-ps3-e3804.jpg',	'Le joueur incarne Ezio Auditore da Firenze, jeune noble italien de 17 ans, qui perd sa famille, assassinée sous ses yeux. Obnubilé par sa soif de vengeance, sa quête le ménera sur les traces des Templiers, en passant par de nombreuses villes emblématiques d\'Italie dont Venise et Florence.',	'2009-11-20 00:00:00',	'2023-08-20 02:20:17',	NULL,	'assassins-creed-ii'),
(27,	'Assassin\'s Creed Brotherhood',	'https://media.senscritique.com/media/000009737375/0/assassin_s_creed_brotherhood.jpg',	'Rome, autrefois glorieuse, est désormais en ruine. La cité n\'est plus que souffrance et décadence. Les citoyens vivent dans l\'ombre de l\'impitoyable famille Borgia. Un seul homme peut libérer le peuple de cette tyrannie : Ezio Auditore, le Maître Assasin.',	'2010-11-18 00:00:00',	'2023-08-20 02:21:32',	NULL,	'assassins-creed-brotherhood'),
(28,	'Assassin\'s Creed Revelations',	'https://image.jeuxvideo.com/images/jaquettes/00040012/jaquette-assassin-s-creed-revelations-pc-cover-avant-g-1322815279.jpg',	'Desmond Miles, après avoir retrouvé la Pomme d\'Éden cachée par son ancêtre Ezio, tue Lucy Stillman dans le Colisée sous le contrôle de l\'artefact et sombre dans le coma, puis est replacé dans l\'Animus. Il y retrouve les bribes de mémoire du Sujet 16, qui lui explique que le mode de fonctionnement spécial dans lequel il se trouve, appelé Chambre noire, lui permettra de \"faire le tri\" entre les mémoires de ses ancêtres et les siennes, afin de reconstruire son esprit et sortir indemne psychiquement de l\'Animus, une épreuve à laquelle le Sujet 16 n\'a pas survécu.',	'2011-11-15 00:00:00',	'2023-08-20 02:23:15',	NULL,	'assassins-creed-revelations'),
(29,	'Assassin\'s Creed III: Liberation',	'https://assets-prd.ignimgs.com/2021/12/30/assassins-creed-liberation-button-1640894424586.jpg',	'En 1765, alors que la Révolution se dessine dans le nord, l\'Espagne cherche à s\'imposer en Louisiane. C\'est sans compter avec Aveline, membre des Assassins. elle utilisera toutes les armes et talents de son arsenal pour offrir la liberté à son peuple et à son pays.',	'2012-10-31 00:00:00',	'2023-08-20 02:24:45',	NULL,	'assassins-creed-iii-liberation'),
(30,	'Assassin\'s Creed III',	'https://image.jeuxvideo.com/medias/153691/1536913023-4984-jaquette-avant.jpg',	'Plus de 200 ans nous séparent de la Renaissance italienne où nous incarnions l\'ancêtre italien Ezio Auditore da Firenze. L\'action nous plonge cette fois-ci pendant la guerre d\'Indépendance des futurs États-Unis, sur le sol nord-américain, dans le conflit où colons et envoyés de la Couronne britannique se livrent des batailles rangées et où nous incarnons un nouvel ancêtre Assassin amérindien.',	'2012-10-30 00:00:00',	'2023-08-20 02:25:50',	NULL,	'assassins-creed-iii'),
(31,	'Assassin\'s Creed IV: Black Flag',	'https://image.jeuxvideo.com/images/jaquettes/00047805/jaquette-assassin-s-creed-iv-black-flag-playstation-4-ps4-cover-avant-g-1377087729.jpg',	'L\'action de Black Flag se déroule en 1715, les pirates règnent sur les Caraïbes et ont fondé leur propre république. Vous incarnerez Edward Kenway, pirate impétueux et rebelle reconnu par les plus grands comme Barbe Noire, plongé dans le conflit sans fin qui oppose Templiers et Assassins.',	'2013-10-29 00:00:00',	'2023-08-20 02:26:45',	NULL,	'assassins-creed-iv-black-flag'),
(32,	'Assassin\'s Creed Rogue',	'https://image.api.playstation.com/cdn/JP0001/CUSA10132_00/Wh098aFfbc0ZxRZGdTzIYCw05SOlX3vi.png',	'Assassin\'s Creed Rogue transporte les joueurs au milieu du 18ème siècle, pendant la Guerre de 7 ans, pour leur faire découvrir une multitude de nouveaux environnements à explorer à travers l\'Amérique du Nord, dont l\'Atlantique Nord, la River Valley et New York.',	'2013-11-13 00:00:00',	'2023-08-20 02:28:00',	NULL,	'assassins-creed-rogue'),
(33,	'Assassin\'s Creed Unity',	'https://m.media-amazon.com/images/I/71lfw0xgZmL.jpg',	'Jeu d\'action-aventure en monde ouvert, Assassin\'s Creed: Unity vous place dans la peau d\'Arno Victor Dorian à l\'époque de la Révolution française. Jeune Assassin évoluant dans le Paris de 1789, le joueur doit faire face à la corruption qui s\'est répandue en France.',	'2014-11-13 00:00:00',	'2023-08-20 02:29:10',	NULL,	'assassins-creed-unity'),
(34,	'Assassin\'s Creed Syndicate',	'https://m.media-amazon.com/images/I/71TlJUu8XAL._AC_UF1000,1000_QL80_.jpg',	'L\'intrigue se déroule à Londres, en 1868, où Jacob et Evie Frye arrivent dans le but de vaincre le templier Crawford Starrick et son organisation, qui contrôle divers rouages importants de la société londonienne (usines, transports, médecine, politique, criminalité...).',	'2015-10-23 00:00:00',	'2023-08-20 02:30:35',	NULL,	'assassins-creed-syndicate'),
(35,	'Assassin\'s Creed Origins',	'https://m.media-amazon.com/images/I/81UtGmLJ90L.jpg',	'L\'histoire d\'Assassin\'s Creed: Origins se déroule durant la dynastie lagide, période durant laquelle Cléopâtre chercha à retrouver son rôle de reine d\'Égypte auprès de Jules César. De nombreux événement relatifs à cette prise de pouvoir sont dépeints dans le jeu, comme ceux de la guerre civile de César.',	'2017-10-27 00:00:00',	'2023-08-20 02:31:30',	NULL,	'assassins-creed-origins'),
(36,	'Assassin\'s Creed Odyssey',	'https://m.media-amazon.com/images/I/71aHh6YZOJL.jpg',	'Grèce, Ve siècle av. J. -C. Vingt ans durant, Kassandra, descendante du puissant roi Léonidas, a tenté d\'oublier la disgrâce dans laquelle elle était tombée : son père, Nikolaos, l\'a bannie de Sparte pour avoir bravé la volonté des dieux et tenté de sauver la vie de son jeune frère.',	'2018-10-05 00:00:00',	'2023-08-20 02:32:12',	NULL,	'assassins-creed-odyssey'),
(37,	'Assassin\'s Creed Valhalla',	'https://m.media-amazon.com/images/I/91lmTAVXgHL._AC_UF1000,1000_QL80_.jpg',	'Un an après avoir découvert l\'Atlantide, le renforcement inexpliqué du champ magnétique terrestre commence à avoir des effets négatifs sur la Terre. Les Assassins reçoivent un signal émis depuis la Nouvelle Angleterre, où Layla Hassan, Shaun Hastings et Rebecca Crane découvrent la tombe d\'un guerrier viking.',	'2020-11-10 00:00:00',	'2023-08-20 02:33:35',	NULL,	'assassins-creed-valhalla'),
(38,	'Watch Dogs',	'https://m.media-amazon.com/images/I/91-0ik6MZWL.jpg',	'Aiden Pearce, citoyen de Chicago, est victime d\'un accident de voiture au cours duquel sa nièce meurt. Pour retrouver et se venger des responsables de cet incident, Aiden Pearce, aidé par une coéquipière, pirate le système de surveillance de toute la ville : le ctOS.',	'2014-10-01 00:00:00',	'2023-08-20 02:35:22',	NULL,	'watch-dogs'),
(39,	'WATCH DOGS 2',	'https://cdn1.epicgames.com/offer/angelonia/WDA_StorePortrait_1200x1600_1200x1600-75d21fb44d647ad69967ae1bb0ab0cbc',	'Lorsque Marcus Holloway, un ingénieur informatique est accusé d\'un crime contre Blume pour piratage alors qu\'il n\'a rien commis, il est recruté par DedSec qui l\'informe des méfaits de Blume avec le CTOS à Chicago.',	'2016-11-15 00:00:00',	'2023-08-20 02:36:04',	NULL,	'watch-dogs-2'),
(40,	'Watch Dogs: Legion',	'https://m.media-amazon.com/images/M/MV5BZjMwNmVjZGMtNjQ1Ni00ZjdjLWI1OTQtYzcwNzAyMjBiODAwXkEyXkFqcGdeQXVyMzY0MTE3NzU@._V1_.jpg',	'Dans un futur proche, Londres court à sa perte : la population est opprimée par un état de surveillance total, des milices privées prennent le contrôle des rues et les plus faibles deviennent la proie du crime organisé.',	'2020-10-29 00:00:00',	'2023-08-20 02:37:14',	NULL,	'watch-dogs-legion'),
(41,	'Fable',	'https://m.media-amazon.com/images/M/MV5BZDczMzc5ODUtNzNiYi00NzhhLTgyMmMtNzBhZGY2MmY0OWIxXkEyXkFqcGdeQXVyMTA0MTM5NjI2._V1_.jpg',	'L\'histoire débute à Oakvale, un petit village tranquille, « épargné par l\'épée », vivant de la pêche et de l\'agriculture. Le joueur incarne un jeune garçon d\'environ douze ans. Le scénario débute avec l\'anniversaire de la sœur du héros.',	'2004-09-14 00:00:00',	'2023-08-20 02:38:49',	NULL,	'fable'),
(42,	'Fable II',	'https://www.giantbomb.com/a/uploads/scale_medium/0/24/221544-fable_ii.jpg',	'Rose et « Moineau » (comme l\'a affectueusement surnommé Rose5) sont deux pauvres orphelins qui survivent dans les rues d\'un quartier populaire de la ville de Bowerstone, la ville qui entoure le château de Fairfax, en Albion.',	'2008-10-24 00:00:00',	'2023-08-20 02:39:47',	NULL,	'fable-ii'),
(43,	'Fable III',	'https://m.media-amazon.com/images/M/MV5BZDRlYTlhMzgtOGU4YS00NTNmLWJiNTAtMDQ4OTFkMTc1YzdiXkEyXkFqcGdeQXVyNjcyNzkwMTc@._V1_.jpg',	'Fable III commence approximativement 50 ans après les événements de Fable II. Le jeu suivra l\'histoire du fils ou de la fille du héros de Bowerstone alors qu\'ils aident à mettre en place une rébellion contre celui qui dirige Albion dans leur quête de devenir roi ou reine.',	'2010-10-26 00:00:00',	'2023-09-14 19:33:48',	NULL,	'fable-iii'),
(44,	'Fable The Lost Chapters',	'https://image.jeuxvideo.com/images/pc/f/t/ftlcpc0f.jpg',	'Fable : The Lost Chapters est un jeu de rôle / action gratiné où vous dirigez un personnage depuis l\'enfance jusqu\'à la barbe blanche. Remplissez les missions confiées par votre guilde et guidez la destinée de votre héros pour devenir une légende du bien ou du mal.',	'2004-09-14 00:00:00',	'2023-08-20 02:42:24',	'2023-09-10 14:08:42',	'fable-the-lost-chapters'),
(45,	'Grand Theft Auto IV',	'https://c.clc2l.com/t/g/r/grand-theft-auto-iv-zM8tg3.jpg',	'Grand Theft Auto IV se déroule en 2007. Niko Bellic est un soldat, ayant servi pendant la guerre de Yougoslavie. C\'est un homme marqué par les terreurs de la guerre. Trahi par ses propres amis durant cette même guerre, et par son ancien boss Ray Bulgarin, Niko cherche à tout prix fuir son passé.',	'2008-04-29 00:00:00',	'2023-08-20 02:43:53',	NULL,	'grand-theft-auto-iv'),
(46,	'Grand Theft Auto San Andreas',	'https://cdn1.epicgames.com/offer/3262906d93334603b399e106492b1217/EGS_GrandTheftAutoSanAndreasTheDefinitiveEdition_RockstarGames_S2_1200x1600-31b942afca6472306be8ae9dfa73290e',	'Grand Theft Auto San Andreas - Rockstar Mag\' Il y a cinq ans, Carl Johnson a échappé aux pressions de la vie à Los Santos, San Andreas, une ville qui se déchire entre les gangs, la drogue et la corruption. Où les stars de cinéma et les millionnaires font de leur mieux pour éviter les dealers et les gangbangers.',	'2004-10-29 00:00:00',	'2023-08-20 02:44:38',	NULL,	'grand-theft-auto-san-andreas'),
(47,	'Grand Theft Auto V',	'https://www.grandtheftauto5.fr/images/jaquette-gta-5.jpg',	'L\'histoire solo suit trois protagonistes : le braqueur de banque à la retraite Michael De Santa (avant l\'accord avec le FIB : Michael Townley), le gangster Franklin Clinton et le trafiquant de drogue et d\'armes Trevor Philips, et leurs braquages sous la pression d\'une agence gouvernementale corrompue et de puissants...',	'2013-09-17 00:00:00',	'2023-08-20 02:45:37',	NULL,	'grand-theft-auto-v'),
(48,	'Red Dead Redemption',	'https://m.media-amazon.com/images/I/51iaWjLVR3S._AC_UF1000,1000_QL80_.jpg',	'Red Dead Redemption s\'étale sur les États américains fictifs de New Austin et West Elizabeth, ainsi qu\'un État mexicain fictif, Nuevo Paraiso. Ces trois États sont adjacents, Nuevo Paraiso étant séparé des deux autres par la rivière San Luis. Le jeu se déroule principalement en 1911, montrant la dernière décennie de la Conquête de l\'Ouest et ses stéréotypes de cow-boys et de hors-la-loi.',	'2010-05-21 00:00:00',	'2023-08-20 02:46:36',	NULL,	'red-dead-redemption'),
(49,	'Red Dead Redemption II',	'https://m.media-amazon.com/images/I/71SyRObF2yL.jpg',	'L\'histoire se déroule en 1899, dans une représentation fictive des États-Unis, et suit les exploits d\'Arthur Morgan, un hors-la-loi et membre du gang Van der Linde, qui doit faire face au déclin de l\'Ouest tout en tentant de survivre contre les forces gouvernementales, gangs rivaux et autres adversaires.',	'2018-10-26 00:00:00',	'2023-08-20 02:47:30',	NULL,	'red-dead-redemption-ii'),
(50,	'LIMBO',	'https://media.senscritique.com/media/000020937446/0/limbo.png',	'Le scénario de Limbo place le joueur dans la peau d\'un garçon anonyme, évoluant dans un monde sombre et hostile, un genre de purgatoire entre la vie et la mort comme un monde désert et désaffecté : on reconnaît à de nombreuses reprises ce qui semble ressembler à une forêt, une usine ou encore une ville.',	'2010-07-21 00:00:00',	'2023-08-20 02:48:28',	NULL,	'limbo'),
(51,	'THE LAST OF US',	'https://image.api.playstation.com/vulcan/ap/rnd/202206/0720/eEczyEMDd2BLa3dtkGJVE9Id.png',	'The Last of Us raconte l\'histoire de deux personnages : Joel et Ellie. Vingt ans après une apocalypse zombie, le monde est à l\'agonie et des communautés tentent de survivre çà et là. Joel, qui a vu sa fille mourir sous ses yeux, est un homme désabusé et aigri.',	'2013-06-14 00:00:00',	'2023-08-20 02:49:43',	NULL,	'the-last-of-us'),
(52,	'The Last of Us Part II',	'https://sm.ign.com/ign_fr/game/t/the-last-o/the-last-of-us-2_trqf.jpg',	'Les évènements de The Last of Us Part II prennent place dans un monde post-apocalyptique, où une pandémie de cordyceps a tué une grande partie de l\'humanité, le reste de la population subsistant tant bien que mal parmi les infectés. Le jeu se déroule en grande partie à Seattle, ainsi qu\'à Jackson et à Santa Barbara.',	'2020-06-19 00:00:00',	'2023-08-20 02:50:28',	NULL,	'the-last-of-us-part-ii'),
(53,	'Far Cry',	'https://image.jeuxvideo.com/images/pc/f/a/facrpc0f.jpg',	'Far Cry premier du nom était un FPS somme toute assez classique. Vous y incarnez Jack Carver, un genre d\'ex militaire super héroïque au passé trouble, qui se retrouve piégé sur une île du Pacifique contrôlée par des mercenaires qui développent des animaux génétiquement modifiés pour la guerre.',	'2004-10-21 00:00:00',	'2023-08-20 02:51:37',	NULL,	'far-cry'),
(54,	'Far Cry 2',	'https://static.actugaming.net/media/2016/02/far-cry-2-cover.jpg',	'Dans un pays fictif d\'Afrique Noire, ravagé par une guerre civile entre deux clans, l\'UFLL et l\'APR, le joueur incarne un mercenaire étranger, ayant pour mission d\'éliminer \"le Chacal\", un trafiquant d\'armes qui alimente la guerre entre les deux factions, mettant ainsi en danger des milliers de civils.',	'2008-10-23 00:00:00',	'2023-08-20 02:52:32',	NULL,	'far-cry-2'),
(55,	'Far Cry 3',	'https://static.posters.cz/image/750/affiches-et-posters/far-cry-3-cover-i13147.jpg',	'L\'histoire de Far Cry 3 se déroule sur l\'archipel de Rook Island, en apparence paradisiaque, situé dans l\'océan Pacifique. La population locale, les Rakyats, est dominée et terrorisée par un groupe de pirates mené par Vaas Montenegro, un Rakyat renégat s\'étant laissé corrompre par l\'argent et la drogue.',	'2012-11-29 00:00:00',	'2023-08-20 02:54:04',	NULL,	'far-cry-3'),
(56,	'Far Cry 4',	'https://www.shoshosein.com/sites/default/files/fiches/jeux-video/far-cry-4/far-cry-4.jpg',	'L\'histoire de Far Cry 4 se déroule dans la région fictive de Kyrat en Himalaya. Le joueur incarne Ajay Ghale, revenu sur sa terre d\'origine pour disperser les cendres de sa mère. Il se retrouvera rapidement plongé au cœur d\'une guerre civile entre les rebelles du Sentier d\'Or et un tyran autoproclamé nommé Pagan Min.',	'2014-11-18 00:00:00',	'2023-08-20 02:54:51',	NULL,	'far-cry-4'),
(57,	'Far Cry 5',	'https://image.api.playstation.com/cdn/EP0001/CUSA05847_00/pEBJnRh6DeL2BfyZRa9jZRrNuSav42QPJIXyqo6Rgcr52o9kYLwY4EpouAzWh4Fu.png',	'Quand une bande de fanatiques décide de contrôler le Comté de Hope, dans le Montana, les habitants se retrouvent avec peu d\'options : accepter le salut ou envoyer tout ce beau monde en enfer. Rejoignez la résistance et affrontez ce culte oppressif pour retrouver la liberté.',	'2018-03-27 00:00:00',	'2023-08-20 02:55:28',	NULL,	'far-cry-5'),
(58,	'Far Cry 6',	'https://image.api.playstation.com/vulcan/img/rnd/202106/0722/4MxzDZKZwtEWyMWZghvwd7bQ.jpg',	'L\'action se déroule à Yara, une île caribéenne fictive sous le joug d\'un dictateur : El Presidente Antón Castillo. Celui-ci élève son fils, Diego, afin d\'en faire son successeur. Il est possible d\'incarner un ou une combattante de la guérilla, Dani Rojas, qui se bat pour renverser Castillo et son régime.',	'2021-10-27 00:00:00',	'2023-08-20 02:56:11',	NULL,	'far-cry-6'),
(59,	'Far Cry Primal',	'https://media.senscritique.com/media/000021063635/0/far_cry_primal.png',	'En tant que dernier survivant de votre groupe de chasseur, vous apprendrez à fabriquer de nombreuses armes létales, à repousser de féroces prédateurs, et à vous montrer plus rusé que les tribus ennemies pour prendre le contrôle d\'Oros et devenir le prédateur ultime.',	'2016-03-23 00:00:00',	'2023-08-20 02:57:11',	NULL,	'far-cry-primal'),
(60,	'Far Cry: New Dawn',	'https://cdn1.epicgames.com/offer/cumin/FCB_StorePortrait_1200x1600_1200x1600-89a688a166ecb85c46cddefc7aa91b44',	'Depuis la guerre nucléaire, la région s\'est remise de la catastrophe et la nature a repris ses droits sur les ruines des différentes villes. L\'environnement a subi entre-temps des mutations liées aux radiations nucléaires. Ainsi, certaines zones sont des déserts irradiés.',	'2019-02-15 00:00:00',	'2023-08-20 02:58:07',	NULL,	'far-cry-new-dawn'),
(61,	'Cyberpunk 2077',	'https://i.etsystatic.com/13367669/r/il/4e4b31/3270863248/il_570xN.3270863248_l1cg.jpg',	'Cyberpunk 2077 est un jeu vidéo d\'action-RPG en vue à la première personne développé par CD Projekt RED, inspiré du jeu de rôle sur table Cyberpunk 2020 conçu par Mike Pondsmith. Le jeu présente un monde futuriste dystopique de type cyberpunk dans lequel la technologie coexiste avec une société humaine dégénérée.',	'2020-12-10 00:00:00',	'2023-08-20 02:59:30',	NULL,	'cyberpunk-2077'),
(62,	'Naruto Shippuden: Ultimate Ninja Storm 3',	'https://cdn.cdkeys.com/700x700/media/catalog/product/u/n/uns-fb.jpg',	'Naruto Shippuden: Ultimate Ninja Storm 3 est un jeu vidéo adapté du manga Naruto, développé par CyberConnect2 et édité par Namco Bandai sorti initialement en mars 2013 sur PlayStation 3 et Xbox 360. Il s\'agit du troisième opus de la série Ultimate Ninja Storm et la suite directe de Naruto Shippuden: Ultimate Ninja Storm 2. ',	'2013-03-08 00:00:00',	'2023-08-20 03:01:06',	NULL,	'naruto-shippuden-ultimate-ninja-storm-3'),
(63,	'KINGDOM HEARTS',	'https://www.emp-online.fr/dw/image/v2/BBQV_PRD/on/demandware.static/-/Sites-master-emp/default/dw44ab59b1/images/5/4/0/3/540373d.jpg?sfrm=png',	'Kingdom Hearts débute sur l\'Île du Destin où Sora, Riku et Kairi habitent. Les trois amis veulent quitter l\'île pour explorer de nouveaux mondes et ont préparé un radeau à cet effet. Un soir, l\'île est attaquée par d\'obscures créatures, les Sans-cœur.',	'2002-11-15 00:00:00',	'2023-08-20 03:02:10',	NULL,	'kingdom-hearts'),
(64,	'KINGDOM HEARTS II',	'https://m.media-amazon.com/images/I/51UFBABZg8L._AC_UF1000,1000_QL80_.jpg',	'Un an a passé et nos trois amis se retrouvent coincés dans un lieu appelé Cité du Crépuscule. Le trio est encore là pour retrouver leurs amis. Kingdom Hearts 2 parvient à réaliser la prouesse de proposer tout ce qu\'on souhaitait voir apparaitre dans cette suite.\n',	'2006-03-28 00:00:00',	'2023-08-20 03:04:35',	NULL,	'kingdom-hearts-ii'),
(65,	'KINGDOM HEARTS Birth by Sleep',	'https://image.jeuxvideo.com/images/jaquettes/00019809/jaquette-kingdom-hearts-birth-by-sleep-playstation-portable-psp-cover-avant-g.jpg',	'Kingdom Hearts: Birth by Sleep commence dans la Contrée du Départ où trois amis proches, Terra, Aqua et Ventus (surnommé Ven) s\'entraînent auprès de Maître Eraqus afin de devenir des Maîtres de la Keyblade. Afin de devenir Maître, les apprentis doivent passer l\'Examen de Symbole de Maîtrise.',	'2010-09-10 00:00:00',	'2023-08-20 03:05:38',	NULL,	'kingdom-hearts-birth-by-sleep'),
(66,	'Need for Speed - Most Wanted',	'https://image.jeuxvideo.com/images/pc/n/s/nsmwpc0f.jpg',	'Des courses, des poursuites et l\'exploration d\'un vaste monde ouvert et connecté où, au volant d\'incroyables voitures, vous devrez échapper à la police et battre vos amis.',	'2005-11-15 00:00:00',	'2023-08-20 03:06:45',	NULL,	'need-for-speed-most-wanted'),
(67,	'Need for Speed – Underground',	'https://image.jeuxvideo.com/images/pc/n/f/nfsupc0f.jpg',	'Avec Need For Speed Underground, les développeurs vous proposent des courses sauvages au volant de monstres de puissance. Personnalisez votre voiture jusque dans les moindres détails, que ce soit une 206, une Golf, une Mazda MX5, une Nissan Skyline et bien d\'autres encore.',	'2003-11-21 00:00:00',	'2023-08-20 03:07:29',	NULL,	'need-for-speed-underground'),
(68,	'Super Mario Sunshine',	'https://static.miraheze.org/fictionwiki/d/d9/61423--super-mario-sunshine.png',	'Mario et la princesse Peach accompagnés de Papy Champi s\'offrent des vacances vers l\'Île Delfino. Leurs vacances commencent mal vu qu\'après avoir affronté une plante piranha de boue, Mario se fait juger au tribunal et est condamné en prison pour un crime qu\'il n\'a pas commis.',	'2002-10-04 00:00:00',	'2023-08-20 03:08:10',	NULL,	'super-mario-sunshine'),
(69,	'Pokémon Diamant et Perle',	'https://media.cdnws.com/_i/149723/4889/757/92/pack-duo-pokemon-diamant-etincellant-perle-switchscintillante.jpeg',	'Suite à un quiproquo, Diamant et Perle se retrouvent à escorter la richissime héritière de la famille Berlitz en direction du Mont Couronné. Mais les deux Dresseurs n\'ont rien de gardes du corps : ils forment en réalité un duo comique et rêvent de devenir des célébrités de la scène !',	'2007-07-27 00:00:00',	'2023-08-20 03:10:08',	NULL,	'pokemon-diamant-et-perle'),
(70,	'Rayman',	'https://image.jeuxvideo.com/images/jaquettes/00001426/jaquette-rayman-playstation-ps1-cover-avant-g-1361809668.jpg',	'L\'équilibre cosmique du monde de Rayman est maintenu par un artéfact, plus précisément une sphère, connu sous le nom de Grand Protoon. Un jour, cependant, l\'antagoniste M. Dark décide de le voler après avoir réussi à vaincre Betilla la Fée qui tentait de protéger l\'artéfact.',	'1995-09-01 00:00:00',	'2023-08-20 03:11:43',	NULL,	'rayman'),
(71,	'Doom Eternal',	'https://image.api.playstation.com/vulcan/ap/rnd/202010/0114/b4Q1XWYaTdJLUvRuALuqr0wP.png',	'À la suite des événements de Doom, la Terre a été envahie par des forces démoniaques, anéantissant 60% de la population de la planète, avec l\'aide de la désormais corrompue Union Aerospace Corporation (UAC).',	'2020-03-20 00:00:00',	'2023-09-20 23:25:51',	'2023-09-10 02:38:57',	'doom-eternal'),
(72,	'Diablo',	'https://vgmsite.com/soundtracks/diablo-1/1235-uuezlpvlgl.jpg',	'Diablo est un jeu vidéo de type hack \'n\' slash, c\'est-à-dire un jeu dans lequel le joueur contrôle en temps réel un personnage devant explorer des donjons et des souterrains peuplés de monstres que le joueur doit combattre pour gagner de l\'expérience ou différents types de trésors comme des armes ou des sorts.',	'1997-01-01 00:00:00',	'2023-09-08 02:22:28',	NULL,	'Diablo'),
(73,	'Diablo II',	'https://lh3.googleusercontent.com/-McB-HQAlzxA/TkYHxHdMKTI/AAAAAAAABr0/jDWYVRbQj1o/s512/Diablo-2-Lord-of-Destruction.jpg',	'Le jeu se déroule dans un monde imaginaire de type médiéval-fantastique dans lequel le joueur peut choisir d\'incarner une amazone, un barbare, un nécromancien, un paladin ou une ensorceleuse dans ses combats contre les armées de créatures démoniaques envoyées dans le monde des hommes par les démons Diablo',	'2000-05-04 00:00:00',	'2023-09-08 02:24:25',	NULL,	'Diablo-II'),
(74,	'Diablo III',	'https://global-img.gamergen.com/jaquette-pc-diablo-iii-3_016501F400388896.png',	'Diablo III se déroule dans le monde imaginaire médiéval-fantastique de Sanctuaire déjà développé dans les deux premiers opus de la série. L’histoire débute dans le royaume de Khanduras vingt ans après les événements décrits dans Diablo II et Diablo II: Lord of Destruction, qui racontent comment des aventuriers sont parvenus à vaincre les démons Mephisto, Diablo et Baal après leur retour dans le monde des hommes.',	'2012-03-15 00:00:00',	'2023-09-20 23:25:10',	NULL,	'Diablo-III'),
(75,	'Wild Arms',	'https://m.media-amazon.com/images/I/61KifXGdNaL._AC_UF1000,1000_QL80_.jpg',	'Lorsqu\'un monstre mangeur de plantes connu sous le nom de \"voleur de fleurs\" attaque une mystérieuse fille nommée Jechika, un jeune garçon, Maxi, doit utiliser une arme ARM interdite pour la sauver et est par la suite expulsé de la ville pour avoir utilisé une technologie illégale.',	'1999-06-15 00:00:00',	'2023-09-08 02:28:07',	'2023-09-08 02:28:26',	'WILD-ARMS'),
(76,	'Crash Bandicoot',	'https://vgmsite.com/soundtracks/crash-bandicoot-1-psx-gamerip/cover.png',	'Crash Bandicoot est un jeu de plates-formes dans lequel le joueur contrôle Crash Bandicoot qui doit traverser les trois îles Wumpa, vaincre son créateur, le Docteur Neo Cortex et sauver Tawna, une femelle bandicoot.',	'1996-06-11 00:00:00',	'2023-09-08 02:29:48',	NULL,	'Crash-Bandicoot'),
(77,	'Final Fantasy VI',	'https://f.ptcdn.info/435/034/000/1439533426-FinalFanta-o.jpg',	'Le jeu se déroule 1000 ans après l’ancienne Guerre de la Magie, dans laquelle les humains et des êtres magiques nommés Espers se sont combattus. La guerre s’est terminée, et désormais les humains et les Espers vivent séparément. Le pouvoir de la magie n’est plus guère cité que dans les contes de fées par les humains qui l’ont remplacée par la technologie',	'1994-05-05 00:00:00',	'2023-09-08 02:32:03',	NULL,	'Final-Fantasy-VI'),
(78,	'Final Fantasy VII',	'https://cdn-uploads.gameblog.fr/images/jeux/657/FinalFantasyVII_PC_Jaquette_002.jpg',	'L’histoire commence lorsque Cloud, mercenaire taciturne, rejoint le groupe éco-terroriste AVALANCHE basé à Midgar, une vaste cité industrielle. Le groupe se compose entre autres de Tifa, une amie d’enfance de Cloud et de Barret, leur chef. AVALANCHE lutte contre la Shinra, une multi-nationale qui produit de l’énergie Mako en prélevant l’énergie spirituelle de la Rivière de la vie des entrailles de la planète Gaïa.',	'1997-05-06 00:00:00',	'2023-09-20 23:24:45',	NULL,	'Final-Fantasy-VII'),
(79,	'Final Fantasy VIII',	'https://image.api.playstation.com/vulcan/img/cfn/11307Q8aq6ePg7TczaSQigyB24Y-on2Qf8xwvfsOskO4RP88LFQSVgoHRuT9er1aCwiUa-auHN5A4syl8Nd-bVzhqDQ2E35X.png',	'L\'histoire de Final Fantasy VIII s\'ouvre sur un duel entre Squall Leonhart et son rival Seifer Almasy, lors d\'une séance d\'entraînement à l\'extérieur d\'une académie militaire appelée « Garden ». Durant le combat, les deux étudiants se blessent le visage l\'un de l’autre et rentrent au Garden pour se faire soigner',	'1999-02-11 00:00:00',	'2023-09-14 19:31:04',	NULL,	'Final-Fantasy-VIII'),
(80,	'Final Fantasy IX',	'https://image.api.playstation.com/cdn/UP0082/CUSA08877_00/w5Qz9UKNBvTZBSRZlV2jeG2BLOJ1u7Jw.png',	'Final Fantasy IX débute lors des festivités données à l\'occasion du seizième anniversaire de la princesse Grenat d\'Alexandrie. Djidane et le groupe des Tantalas veulent en profiter pour enlever la jeune fille sous les ordres de leur mystérieux commanditaire.',	'2000-06-07 00:00:00',	'2023-09-08 02:36:24',	'2023-09-08 02:36:44',	'Final-Fantasy-IX'),
(81,	'Final Fantasy X',	'https://assets-prd.ignimgs.com/2021/12/20/ffx-art-1640032077055.jpg',	'Tidus, champion de blitzball de la ville futuriste de Zanarkand, doit participer à un tournoi organisé pour les 10 ans de la disparition de Jecht, légende du blitzball et père de Tidus. Mais en plein milieu du match, un monstre gigantesque apparaît et détruit la ville, et Tidus finit par être assommé.',	'2001-07-19 00:00:00',	'2023-09-10 02:38:48',	NULL,	'Final-Fantasy-X'),
(82,	'Sonic The Hedgehog',	'https://upload.wikimedia.org/wikipedia/en/b/ba/Sonic_the_Hedgehog_1_Genesis_box_art.jpg',	'Histoire. Le premier jeu Sonic, intitulé Sonic the Hedgehog, est un jeu de plateforme commercialisé en 1991, mettant en scène le protagoniste Sonic courant à travers différents niveaux du jeu afin d\'arrêter le Dr Robotnik, et de l\'empêcher de conquérir le monde.',	'1991-02-01 00:00:00',	'2023-09-09 16:11:00',	NULL,	'Sonic-The-Hedgehog'),
(83,	'Call of Duty: Black Ops II',	'https://thumbnails.pcgamingwiki.com/7/75/Call_of_Duty_Black_Ops_II_Cover.png/300px-Call_of_Duty_Black_Ops_II_Cover.png',	'Le jeu se déroule donc en 2025, époque où le joueur incarne David \"Section\" Mason, le fils d\'Alex Mason, le protagoniste de la campagne de Call of Duty : Black Ops. Il est aidé par Mike Harper et Javier Salazar à pourchasser et éliminer Raul Menendez, un trafiquant d\'armes Nicaraguayen, antagoniste principal du jeu.',	'2012-11-13 00:00:00',	'2023-09-09 19:25:39',	NULL,	'Call-of-Duty-Black-Ops-II'),
(84,	'Detroit Become Human',	'https://image.api.playstation.com/vulcan/img/rnd/202010/2119/wl4DB5QGzlEHAXy1KLUVgOAu.png',	'Détroit, 2038. L\'évolution de la technologie a créé un monde où les robots androïdes sont partout. Ils parlent, se déplacent et se comportent comme des humains mais ils ne sont que des machines au service de ces derniers. À travers les yeux de trois androïdes, découvrez un monde au bord du chaos.',	'2018-05-25 00:00:00',	'2023-09-20 23:25:33',	NULL,	'Detroit-Become-Human'),
(85,	'Rayman Legends',	'https://image.api.playstation.com/gs2-sec/appkgo/prod/CUSA00031_00/1/i_de7f2d4471d56be1911987fdae0711e95cd6f21b0ae43c57c70d0bf785ae4acb/i/icon0.png',	'Pendant un siècle entier, les héros de la Croisée des Rêves (Rayman, Globox et les deux Ptizètres) ont passé leur temps à dormir profondément. Selon les dires du Bulleur de Rêves, ces derniers sont sous l\'emprise d\'un puissant somnifère mystérieux ou alors ils avaient juste besoin de prendre beaucoup de repos.',	'2013-08-30 00:00:00',	'2023-09-09 21:45:18',	NULL,	'Rayman-Legends'),
(86,	'The Sims',	'https://image.jeuxvideo.com/images/pc/s/i/simspc0f.jpg',	'Les Sims est une simulation de vie proposant de gérer la vie des sims — les habitants de la série Sim City — en leur donnant des directives. Une partie ne se termine jamais car même s\'il n\'y a plus de sims vivants, le joueur est libre d\'en créer de nouveau.',	'2006-02-01 00:00:00',	'2023-09-09 22:09:04',	NULL,	'The-Sims'),
(87,	'The Sims 2',	'https://m.media-amazon.com/images/I/51KTZ5EG6ML.jpg',	'Les Sims 2 est un jeu vidéo de simulation de vie développé par Maxis, édité par Electronic Arts le 14 novembre 2004 sur PC',	'2004-11-14 00:00:00',	'2023-09-09 22:22:40',	NULL,	'The-Sims-2'),
(88,	'The Sims 3',	'https://m.media-amazon.com/images/I/71DLhfD9DlL._AC_UF1000,1000_QL80_.jpg',	'Comme dans les deux premiers opus de la série, le but du jeu est de s\'occuper de plusieurs personnages (appelés \"Sims\") tout au long de leur vie. Chaque joueur contrôle tous les aspects de la vie de son Sim (famille, travail…) et décide entièrement de son destin.',	'2009-06-04 00:00:00',	'2023-09-09 22:42:20',	'2023-09-09 22:49:43',	'The-Sims-3'),
(89,	'The Sims 4',	'https://m.media-amazon.com/images/I/71otyq1xFNL.jpg',	'Les Sims 4 est une simulation de vie qui permet au joueur de créer ses personnages et de les faire évoluer dans un univers qu\'il customise lui-même.',	'2014-09-04 00:00:00',	'2023-09-09 22:54:45',	NULL,	'The-Sims-4'),
(90,	'Among Us',	'https://image.api.playstation.com/vulcan/img/rnd/202107/0115/D5IIJwm65MLMPENwWzzO7rjd.png',	'Des membres de votre équipage ont été remplacés par un extraterrestre qui a l\'intention de semer la confusion, de saboter le vaisseau et de tuer tout le monde. Dénichez l\'\"Imposteur\" ou devenez la victime de ses desseins meurtriers.',	'2018-06-15 00:00:00',	'2023-09-09 23:06:46',	NULL,	'Among-Us');
